package main

import (
	"fmt"
	"sort"
)

func main() {
	w, h := len(input[0]), len(input)
	sum := 0
	var lows [][2]int
	for y := 1; y < h-1; y++ {
		for x := 1; x < w-1; x++ {
			c := input[y][x]
			n := [4]int{
				input[y+1][x],
				input[y-1][x],
				input[y][x+1],
				input[y][x-1],
			}
			if c < n[0] && c < n[1] && c < n[2] && c < n[3] {
				sum += c + 1
				lows = append(lows, [2]int{x, y})
			}
		}
	}
	fmt.Println("part 1)", sum)

	at := func(pos [2]int) int {
		x, y := pos[0], pos[1]
		return input[y][x]
	}

	var sizes []int
	for _, low := range lows {
		queue := [][2]int{low}
		var done [][2]int
		for len(queue) > 0 {
			start := queue[0]
			left := offset(start, -1, 0)
			right := offset(start, 1, 0)
			up := offset(start, 0, -1)
			down := offset(start, 0, 1)

			basin := func(pos [2]int) bool {
				return !contains(queue, pos) &&
					!contains(done, pos) &&
					at(pos) != 9 &&
					at(pos) > at(start)
			}

			if basin(left) {
				queue = append(queue, left)
			}
			if basin(right) {
				queue = append(queue, right)
			}
			if basin(up) {
				queue = append(queue, up)
			}
			if basin(down) {
				queue = append(queue, down)
			}

			done = append(done, queue[0])
			queue = queue[1:]
		}
		sizes = append(sizes, len(done))
	}
	sort.Slice(sizes, func(i, j int) bool { return sizes[i] > sizes[j] })
	fmt.Println("part 2)", sizes[0]*sizes[1]*sizes[2])
}

func offset(p [2]int, dx, dy int) [2]int {
	p[0] += dx
	p[1] += dy
	return p
}

func contains(list [][2]int, x [2]int) bool {
	for i := range list {
		if list[i] == x {
			return true
		}
	}
	return false
}

